Descrição:
Muitas funcionalidades em um só produto. O refrigerador Duplex Consul CRD37 é o que faltava na sua cozinha.
\n
\nO Refrigerador 2 Portas 334 Litros, possui amplo freezer, com prateleira na porta que facilita a organização de seus alimentos congelados. Além disso, garante mais economia, pois tem classificação A em consumo de energia. Conta com Gavetão Transparente que facilita a visualização dos produtos, sem precisar abrir a gaveta e os mantém na temperatura correta preservando as características das frutas e legumes, e faz com que sua cozinha fique sempre em ordem e suas compras fresquinhas.
\n
\nO controle eletrônico ajuda você a regular e estabelecer a temperatura ideal para cada compartimento. Assim você economiza energia, mantém tudo mais fresquinho e também conserva seus alimentos por muito mais tempo. Muito espaço, muita organização e muita facilidade. Para você deixar só uma coisa de fora da sua geladeira: a bagunça.
